import React from "react";

function About() {

    return (
        <>
            <div className="p-6">
                <h1 className="text-4xl pb-4 font-semibold">About ExpenseTracker</h1>
                <p className="text">ExpenseTracker is a sophisticated financial management solution designed for individuals and businesses seeking to optimize their financial health. Our platform combines cutting-edge technology with user-friendly interfaces to provide a comprehensive tool for expense tracking, budget planning, and financial analysis. With ExpenseTracker, you're empowered to make informed decisions and achieve your financial goals with confidence.
                </p>
            </div>
        </>
    )
}

export default About
